let width=window.innerWidth/100,height=window.innerHeight/100
export const responsive={
    heading:function(){
        let main={
            color:'wheat',
            height:`${5*height}px`,
            width:`${100*width}px`,
            fontSize:`${Math.min(3*height,5*width)}px`,
           // backgroundColor:'grey',
            position:'relative'
        }
        let hr={
            color:'wheat',
            height:`${1*height}px`,
            width:`${100*width}px`,
            position:'relative'
        }
        return [main,hr];
    }
}
